import React, { Component, Fragment} from 'react'
import Button from '@material-ui/core/Button';
import MapIcon from '@material-ui/icons/Map';

class searchSection extends Component {

  constructor(props)
  {
    super(props)
  }

  render() {

    return (
      <div>

        <style jsx>
          {`
            .root{
              width:100%;
              height:200px;
              background:ghostwhite;
              padding:15px
            }
          `}
        </style>
        <div className="root">
            <h1 style={{margin:'0'}}>Hola Camilo!</h1>
            <p><small>Tu dirección: Cra 13 # 152 - 80 AP 715</small></p>
            <p>Hay 250 tiendas y negocios cerca de tí. Encuentra lo que estás buscando y <b>haz un pedido.</b></p>
            <Button
              variant="contained"
              color="primary"
              size="large"
              startIcon={<MapIcon />}
            >
              Ver el mapa
            </Button>
        </div>
      </div>
    )
  }
}

export default searchSection;
